import styled from "@emotion/styled";

const FooterContainer = styled.div`
  height: 30rem;
  background: black;
  color: white;
  display: grid;
  grid-template-columns: 1fr 1fr 1fr;
`;

const ContactUs = styled.div``;
const Service = styled.div``;
const Payment = styled.div``;

export const Footer = () => {
  return (
    <FooterContainer>
      <ContactUs>
        <h2>ติดต่อเรา</h2>
      </ContactUs>
      <Service>
        <h2>บริการ</h2>
      </Service>
      <Payment>
        <h2>การชำระเงิน</h2>
      </Payment>
    </FooterContainer>
  );
};
